    <template id="intro3" transition="landing" auto-advance="32"><ascii-grid style="width: 100%; height: 100%; border-radius: 0px; display: grid; margin: auto; grid-template-areas: &quot;g0&quot; &quot;g1&quot; &quot;g2&quot;;"><!--#

--><div style="display: flex; justify-content: center; align-items: center; grid-area: g0 / g0 / g0 / g0;" data-type="undefined">Lake Zurich reflected the whispy white autumn clouds, yet the water       was clear enough that it was easy to spot fish and see the sandy bed       several metres below. The fresh smell of reeds and algae was in the air.       Distant and indistinct sounds from the shore could be heard over the       lapping of the water against the hull.</div><div style="display: flex; justify-content: center; align-items: center; grid-area: g1 / g1 / g1 / g1;" data-type="undefined">The dinghy glided through the water towards an outcrop covered in       trees within which could be seen an irregular group of white-washed       towers and walls.</div><div style="display: flex; justify-content: center; align-items: center; grid-area: g2 / g2 / g2 / g2;" data-type="undefined">The taciturn youth at the helm had simply promised to land at a       secret location ripe for exploration.</div></ascii-grid></template>
